import "./Title.css";

function Tile( {className , value, onClick,turn} ) {
    let h=null;
if(value==null && turn !=null){
    h=`${turn.toLowerCase()-hover}`;
}


    return ( 
        <div onClick={onClick} className={`tile ${className} ${h}`}>{value}</div>
     );
}

export default Tile;
